+        assertEquals("Library for row " + rowIndex,
+                expectedRow[4], actualRow.getBinary());
+        assertArrayEquals("PMC-counters for row " + rowIndex,
+                (long[]) expectedRow[5], actualRow.getPmcCounters());
+    }
